resources.string:
Təlimat:
--------------
-Lütfən "Nüsxələ" düyməsinə toxunun;
-Wi-Fi və ya Mobil şəbəkəni açın və proqrama bütün əlaqələr üçün icazə verin;
-Model seçin və "Yamaqla" düyməsinə toxunun;
-"Aç" düyməsini toxunaraq lisenziya vəziyyətini yoxlayın (lazım olsa, yeniləyin);
-Bu model kömək etməsə, "Bərpa et" toxunun və fərqli model ilə yenidən yoxlayın.
 Əgər əməliyyat uğurlu olsa, "Dəyişiklikləri saxla" düyməsinə toxunun.

Kömək:

 - Orijinal hex üçün model (uzunluq>3):
 AA 1F ** 01 4C
 ** - hər hansı bayt;

 - Dəyişdiriləcək hex üçün model (uzunluq>3):
 EA 2F ** ** **
 ** - bayt dəyişdirilmir;

Orijinal bayt və dəyişdiriləcək bayt sayı bərabər olmalıdır;
